func findIntersectionValues(nums1 []int, nums2 []int) []int {
    // Create maps to keep track of unique elements in each array
    uniqueNums1 := make(map[int]bool)
    uniqueNums2 := make(map[int]bool)

    // Count unique elements in nums1 that are present in nums2
    for _, num := range nums1 {
        uniqueNums1[num] = true
    }
    count1 := 0
    for num := range uniqueNums1 {
        if contains(nums2, num) {
            count1++
        }
    }

    // Count unique elements in nums2 that are present in nums1
    for _, num := range nums2 {
        uniqueNums2[num] = true
    }
    count2 := 0
    for num := range uniqueNums2 {
        if contains(nums1, num) {
            count2++
        }
    }

    // Return the results
    return []int{count1, count2}
}

// Helper function to check if a slice contains a specific element
func contains(slice []int, element int) bool {
    for _, v := range slice {
        if v == element {
            return true
        }
    }
    return false
}
